$(function(){

    //intro video
    $("#video").YTPlayer();
    $("#player").YTPlayer();

    $('.intro__play--2').on('click',function(){
        $('.intro__content').animate({'left':'-50vw'},1500);
        $('.intro__half').animate({'left':'-100vw'},1400);
        $(this).fadeOut();
        $("#video").YTPStop().YTPPlay().YTPUnmute();
        $('.intro__close').fadeIn();
        $(this).removeClass('d-lg-block');
    })

    $('.intro__close').click(function(){
        $('.intro__content').animate({'left':'0vw'},1500);
        $('.intro__half').animate({'left':'-10vw'},1400);
        $('.intro__play--2').addClass('d-lg-block');
        $("#video").YTPMute();
        $(this).fadeOut();
    });
    //intro video

    //mydropdown
    $('.mydropdown').each(function(){
        var obj = $(this)

        $(this).parent().hover(function(event){
            event.stopPropagation();
            obj.toggle();
        },function(event){
            event.stopPropagation();
            obj.toggle();
        });
    });

    $(window).click(function() {
        $('.mydropdown').hide();
    });
    //mydropdown

    $(".button--arrowtop").click(function() {
        $("html, body").animate({ scrollTop: 0 }, "slow");
        return false;
    });

    //header__menu
    $('.header__menu').click(function(){
       if($('.navtop').hasClass('d-block'))
       {
           $('.navtop').removeClass('d-block');
           $('.button--arrow').removeClass('d-block').addClass('d-none');
           $('.button--iconcart').addClass('d-block').removeClass('d-none');
           $(this).removeClass('header__menu--active');
       }
       else
       {
           $('.button--iconcart').removeClass('d-block').addClass('d-none');
           $('.button--arrow').addClass('d-block').removeClass('d-none');
           $('.navtop').addClass('d-block');
           $(this).addClass('header__menu--active');
       }
    });

    $('.magnificPopup').magnificPopup({
        type: 'image',
        fixedContentPos:false,
        closeOnContentClick: true,
        image: {
            verticalFit: false
        },
        gallery: {
            enabled: true
        }
    });

    $('.magnificYoutube').magnificPopup({
        type: 'iframe',
        mainClass: 'mfp-fade',
        removalDelay: 160,
        preloader: false,
        fixedContentPos: false
    });

    if($('.collapsor__item').length>0)
    {
        $('.collapsor__item').each(function(){
            var parent = $(this);
            parent.find('.collapsor__header').click(function(){
                parent.siblings().find('.collapsor__body').slideUp(function(){
                    $(this).parents('.collapsor__item').find('.collapsor__header').removeClass('collapsor__header--active');
                    $(this).removeClass('collapsor__body--active');
                })

                $(this).toggleClass('collapsor__header--active');
                parent.find('.collapsor__body').slideToggle(function(){
                    $(this).toggleClass('collapsor__body--active');
                })
            }) ;
        });
    };

    $(window).resize(function(){
        if($(window).width()<992)
        {
            $('.navtop__link').unbind('click');
            $('.navtop__link').on('click',function(e){
                var obj = $(this);
                if($(this).parent().find('.navtop__submenu').length>0)
                {
                    if($(this).parent().find('.navtop__submenu').hasClass('active')) {
                        $(this).parent().find('.navtop__submenu').removeClass('active').hide();
                        obj.removeClass('navtop__link--active');
                    }
                    else {
                        $(this).parent().find('.navtop__submenu').addClass('active').show();
                        obj.addClass('navtop__link--active');
                    }
                    return false;
                }
            })
        }

        var playerReady = null;
        $(window).scroll(function () {
            if($('#playerArea').length>0 && $(window).width()>1199) {
                var hMin = $('#playerArea').offset().top - 100;
                var hMax = parseInt($('#playerArea').offset().top) + parseInt($('#playerArea').outerHeight()) - 100;

                if(playerReady==null) {
                    if ($(window).scrollTop() >= hMin && $(window).scrollTop() <= hMax) {
                        $("#player").YTPStop().YTPPlay();
                        playerReady = 1;
                    }
                }
            }
        }).scroll();


        $(window).scroll(function () {
          var top = 65;
          var padding = $(window).scrollTop();

          if ($(window).scrollTop() < top) {
              $('.header').css('top', (top-padding)+'px');
          }
          else {
              $('.header').css('top','0px');
          }

        });


        if($('.submenu').length>0 && $(window).width()>1199) {
            var top = $('.submenu').offset().top;
            var paddingBody = parseInt($('body').css('padding-top'));

            $(window).scroll(function () {
                if ($(window).scrollTop() > top) {
                    $('.submenu').addClass('submenu--fixed');
                    $('body').css('padding-top',paddingBody+parseInt($('.submenu').height())+'px');
                }
                else {
                    $('.submenu').removeClass('submenu--fixed');
                    $('body').css('padding-top',paddingBody+'px');
                }

                var hMin = $('#overview').offset().top-100;
                var hMax = parseInt($('#overview').offset().top)+parseInt($('#overview').outerHeight())-100;
                if($(window).scrollTop()>=hMin && $(window).scrollTop()<=hMax)
                {
                    $('.submenu__link--overview').addClass('active');
                }
                else
                {
                    $('.submenu__link--overview').removeClass('active');
                }

                var hMin = $('#kit').offset().top-100;
                var hMax = parseInt($('#kit').offset().top)+parseInt($('#kit').outerHeight())-100;
                if($(window).scrollTop()>=hMin && $(window).scrollTop()<=hMax)
                {
                    $('.submenu__link--kit').addClass('active');
                }
                else
                {
                    $('.submenu__link--kit').removeClass('active');
                }

                var hMin = $('#integration').offset().top-100;
                var hMax = parseInt($('#integration').offset().top)+parseInt($('#integration').outerHeight())-100;
                if($(window).scrollTop()>=hMin && $(window).scrollTop()<=hMax)
                {
                    $('.submenu__link--integration').addClass('active');
                }
                else
                {
                    $('.submenu__link--integration').removeClass('active');
                }

                var hMin = $('#specification').offset().top-100;
                var hMax = parseInt($('#specification').offset().top)+parseInt($('#specification').outerHeight())-100;
                if($(window).scrollTop()>=hMin && $(window).scrollTop()<=hMax)
                {
                    $('.submenu__link--specification').addClass('active');
                }
                else
                {
                    $('.submenu__link--specification').removeClass('active');
                }

                var hMin = $('#support').offset().top-100;
                var hMax = parseInt($('#support').offset().top)+parseInt($('#support').outerHeight())-100;
                if($(window).scrollTop()>=hMin && $(window).scrollTop()<=hMax)
                {
                    $('.submenu__link--support').addClass('active');
                }
                else
                {
                    $('.submenu__link--support').removeClass('active');
                }

            }).scroll();
        }
    }).resize();

    $('#3d').reel({
        responsive:true,
        frames:218,
        timeout:3,
        cursor:'move',
        speed:0.05,
        // cw:true,
        // duration:1,
        images:'./images/3d/big-clown-3-#-2.jpg|1..218'
    }).bind("frameChange", function(e, d, frame){
        var proc = frame/218*100;
        $('.threed__slider__active').width(proc+'%');
        $('.threed__slider__point').removeClass('threed__slider__point--active');
        $('.threed__slider__point').removeClass('threed__slider__point--full');

        if(proc>0)
        {
            $('.threed__slider__point--1').addClass('threed__slider__point--active');
        }
        if(proc>20)
        {
            $('.threed__slider__point--2').addClass('threed__slider__point--active');
        }
        if(proc>40)
        {
            $('.threed__slider__point--3').addClass('threed__slider__point--active');
        }
        if(proc>60)
        {
            $('.threed__slider__point--4').addClass('threed__slider__point--active');
        }
        if(proc>80)
        {
            $('.threed__slider__point--5').addClass('threed__slider__point--active');
        }
        if(proc>=100)
        {
            $('.threed__slider__point--6').addClass('threed__slider__point--active');
        }

        if(proc>=0 && proc<=1)
        {
            $('.threed__slider__point--1').addClass('threed__slider__point--full');
        }
        if(proc>=20 && proc<=21)
        {
            $('.threed__slider__point--2').addClass('threed__slider__point--full');
        }
        if(proc>=40 && proc<=41)
        {
            $('.threed__slider__point--3').addClass('threed__slider__point--full');
        }
        if(proc>=60 && proc<=61)
        {
            $('.threed__slider__point--4').addClass('threed__slider__point--full');
        }
        if(proc>=80 && proc<=81)
        {
            $('.threed__slider__point--5').addClass('threed__slider__point--full');
        }
        if(proc>=99 && proc<=100)
        {
            $('.threed__slider__point--6').addClass('threed__slider__point--full');
        }
    });

    $('.threed__slider__point--1').on('click',function(e){
        $('#3d').reel('frame',Math.round(0*218));
    })
    $('.threed__slider__point--2').on('click',function(e){
        $('#3d').reel('frame',Math.round(0.2*218));
    })
    $('.threed__slider__point--3').on('click',function(e){
        $('#3d').reel('frame',Math.round(0.4*218));
    })
    $('.threed__slider__point--4').on('click',function(e){
        $('#3d').reel('frame',Math.round(0.6*218));
    })
    $('.threed__slider__point--5').on('click',function(e){
        $('#3d').reel('frame',Math.round(0.8*218));
    })
    $('.threed__slider__point--6').on('click',function(e){
        $('#3d').reel('frame',Math.round(1*218));
    });

    //scroll
    $('a[href*="#"]')
    // Remove links that don't actually link to anything
        .not('[href="#"]')
        .not('[href="#0"]')
        .click(function(event) {
            // On-page links
            if (
                location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '')
                &&
                location.hostname == this.hostname
            ) {
                // Figure out element to scroll to
                var target = $(this.hash);
                target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
                // Does a scroll target exist?
                if (target.length) {
                    // Only prevent default if animation is actually gonna happen
                    event.preventDefault();
                    $('.submenu__link').removeClass('active');
                    $(this).addClass('active');
                    $('html, body').animate({
                        scrollTop: target.offset().top
                    }, 1000, function() {
                        // Callback after animation
                        // Must change focus!
                        var $target = $(target);
                        $target.focus();
                        if ($target.is(":focus")) { // Checking if the target was focused
                            return false;
                        } else {
                            $target.attr('tabindex','-1'); // Adding tabindex for elements not focusable
                            $target.focus(); // Set focus again
                        };
                    });
                }
            }
        });

    $('.slick').not('.slick--2').slick({
        dots: true,
        infinite: true,
        speed: 300,
        slidesToShow: 3,
        slidesToScroll: 1,
        arrows:false,
        responsive: [
            {
                breakpoint: 1024,
                settings: {
                    slidesToShow: 2
                }
            },
            {
                breakpoint: 767,
                settings: {
                    slidesToShow: 1
                }
            }
        ]
    });

    $('.slick--2').slick({
        dots: true,
        infinite: true,
        speed: 300,
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows:false
    });
});
